INSERT INTO `company` (`CID`, `COMP_ID`, `COMP_NAME`, `COMP_IMGNAME`, `COMP_IMG`, `COMP_DETAIL`, `COMP_ADDR_STREET`, `COMP_ADDR_CITY`, `COMP_ADDR_STATE`, `COMP_ADDR_POST`, `COMP_PHONE`, `COMP_EMAIL`) VALUES
(1, 'KKL', 'KKKL Travel & Tours', 'kkkl_logo.png', , 'KKKL Travel &amp; Tours are the subsidiary of KKKL Express Malaysia. KKKL Express bus, is famous by providing daily coach service from Singapore to Hatyai and Genting for almost 20 years. It was previously managed by agents in Singapore but now they have opened their own travel office in Singapore. By opening their own office, KKKL Travel &amp; Tours aims to provide the best one stop services for customer travelling. They have various service, from daily express bus from Singapore to Malacca and Kuala Lumpur to travel packages which include free and easy travel package, hotel booking and city tour. Besides these, they provide coach chartering service as well. If you would like to travel to Malaysia by coach, think of KKKL Travel &amp; Tours, they have the complete travel solutions for your needs.', 'Melaka Sentral Bus Terminal, R1, Jalan Tun Razak, Plaza Melaka Sentral', 'Melaka', 'MLK', '75450', '062836789', 'helpdesk@busforall.my');
INSERT INTO `company` (`CID`, `COMP_ID`, `COMP_NAME`, `COMP_IMGNAME`, `COMP_IMG`, `COMP_DETAIL`, `COMP_ADDR_STREET`, `COMP_ADDR_CITY`, `COMP_ADDR_STATE`, `COMP_ADDR_POST`, `COMP_PHONE`, `COMP_EMAIL`) VALUES
(2, 'DLM', 'Delima Express', 'delima.jpg', , 'One of the longest serving (and most popular) express bus companies in Malacca (Melaka) is Delima Express. They held a great reputation in serving commuters travelling to few destinations for more than 20 years. For years, their vision is to provide safety ride as well as the most comfortable journey to their passengers. Delima Express provides return trip from Malacca to Singapore, Johor Bahru (JB) and Kuala Lumpur (KL) and vise versa. Delima Express has announced that their service from Singapore to Malacca will be a non stop jorney for their customer&#39;s convenience.', 'Melaka Sentral Bus Terminal, R1, Jalan Tun Razak, Plaza Melaka Sentral', 'Melaka', 'MLK', '75400', '062839333', 'helpdesk@busforall.my');
INSERT INTO `company` (`CID`, `COMP_ID`, `COMP_NAME`, `COMP_IMGNAME`, `COMP_IMG`, `COMP_DETAIL`, `COMP_ADDR_STREET`, `COMP_ADDR_CITY`, `COMP_ADDR_STATE`, `COMP_ADDR_POST`, `COMP_PHONE`, `COMP_EMAIL`) VALUES
(3, 'TRN', 'Transnasional', 'logo-trans3.png', , 'Transnasional, a Malaysian icon and the leader of the express bus industry, is one of the most prominent and popular household brand names in Southeast Asia region, serving more than 200 destinations, covering all major cities and towns with 1,000 daily departures across Peninsular Malaysia and Singapore. Using the latest advancement in bus technologies, design and comfort, Transnasional provides safe, enjoyable and affordable travel.Transnasional was also the first to provide insurance coverage for passenger and baggage, whereby in the case of unfortunate event, the passengers are covered for medical expenses or loss of baggage.', 'Melaka Sentral Bus Terminal, R1, Jalan Tun Razak, Plaza Melaka Sentral', 'Melaka', 'MLK', '75400', '062839773', 'helpdesk@busforall.my');
INSERT INTO `company` (`CID`, `COMP_ID`, `COMP_NAME`, `COMP_IMGNAME`, `COMP_IMG`, `COMP_DETAIL`, `COMP_ADDR_STREET`, `COMP_ADDR_CITY`, `COMP_ADDR_STATE`, `COMP_ADDR_POST`, `COMP_PHONE`, `COMP_EMAIL`) VALUES
(4, 'PLR', 'Plusliner', 'plusline.jpg', , 'Plusliner, dubbed as the King of Highway Express more than 10 years ago has been cruising along our major highways, connecting major towns and brings people closer to each other. From Bukit Kayu Hitam up in the North to Johor Bharu down in the South and Kuantan in the East, countless satisfied passengers gave their thumbs up to Plusliner for the kind of service which is a class of its own. Our highly trained Coach Captains are committed to take you along with your belongings to set destinations in a safe, comfortable and timely fashion. So whether your next journey is for business or pleasure, going solo or with a company, let Plusliner takes your there.', 'Mega Syuhada Sdn Bhd, No 3, Jalan Masjid', 'Padang Besar', 'PLS', '02100', '062834333', 'helpdesk@busforall.my');
